import React, {useEffect, useState} from 'react';
import {getAllUsers} from "../../http/userAPI";
import InfoCell from "../../Components/InfoCell/InfoCell";

const UsersListPage = () => {
    const [users, setUsers] = useState(null);
    const {email, name, surname, shop_id, role, id} = users;
    useEffect(() => {
        async function fetchUsers () {
            const users = await getAllUsers();
            return users;
        }
        fetchUsers().then(users => setUsers(users.data))
    }, [])


    return (
        <div>
            users page list
            <div>
                <span>Имя:</span>
                <span>{name}</span>
            </div>
            <div>
                <span>Фамилия: </span>
                <span>{surname}</span>
            </div>
            <div>
                <span>Емейл:</span>
                <span>{email}</span>
            </div>
            <div>
                <span>Адрес:</span>
                <span>{shop_id}</span>
            </div>
            <div>
                <span>Роль:</span>
                <span>{role}</span>
            </div>
            <div>
                <span>Name:</span>
                <span>{name}</span>
            </div>
        </div>
    );
};

export default UsersListPage;
